    "descricao": "CONSIDERANDO O QUE FOI VISUALIZADO NA IMAGEM, PASSO A DECLARAR: É POSSÍVEL VISUALIZAR UM VEICULO PALIO NA COR BRANCA, ESTACIONADO PELA VIA, OCUPADO POR DOIS INDIVIDUOS MAIORES, SENDO UM DO SEXO MASCULINO E UM DO SEXO FEMININO, E UMA CRIANÇA DO SEXO FEMININO NO BANCO TRASEIRO. \n\nDO OUTRO LADO DA VIA, É POSSÍVEL VISUALIZAR UM INDIVIDUO DO SEXO FEMININO, ADULTO, APARENTEMENTE AGUARDANDO PELA CRIANÇA. AO AVISTAR O ADULTO, A CRIANÇA ABRE A PORTA DO VEICULO E DISPARA A CORRER, ATRAVESSANDO EM FRENTE AO ONIBUS QUE NÃO TEVE TEMPO HÁBIL PARA FREIAR. \n\nO VEICULO DE DIVERSAS TONELADAS, ATROPELA A CRIANÇA, COM A RODA DIANTEIRA DIREITA, PASSANDO POR CIMA DO DORSO DA CRIANÇA, QUE APARENTEMENTE FOI A OBITO NO LOCAL. \n\nNO QUE É POSSIVEL VISUALIZAR, MESMO COM A BAIXA QUALIDADE DA IMAGEM, TRATA-SE DE MORTE EVIDENTE. POSTERIORMENTE RATIFICADA PELO SAMU AVANÇADO. \n\nFOI EMPENHADO O TRANSITO PARA CANALIZAÇÃO DO TRANSITO E DESVIO DO CONJUNTO VIÁRIO.\n\nFOI ISOLADA A AREA, PREJUDICANDO A AVENIDA GENERAL MOTORS POR ALGUMAS HORAS, PARA PERÍCIA, CERCEANDO O DIREITO E IR E VIR PARA ELUCIDAR CRIME GRAVE. \n\nFOI ACIONADO DELEGADO DE POLICIA AO LOCAL. POLICIAIS MILITARES ELABORARAM AUTOS DETALHADOS REFERENTE AO FATO. \n\nO ONIBUS APARENTEMENTE TRAFEGAVA DENTRO DAS CONDIÇÕES PREVISTAS PELO CTB.",
