    "id_natureza": 77,
    "user_name": "Luiz Antonio Espósito",
    "descricao": "Câmeras: 014.2= 08:15-08:17, 014.4= 08:15-08:16, 091.2= 08:21-08:23, 091.4= 08:55-08:57, 448= 08:22-08:24, 449= 08:57-08:59, 223= 08:58-09:04\n\nApós alerta emitido pela câmera do viaduto Everardo Passos de veículo furtado GM Classic placas ETI5G48, acompanhamos e orientamos\naté que uma equipe da PM abordou na zona norte, na Rua Jaguari (SIOPM 11313).\n\nLogo após constatamos que um veículo VW FOX placas DXX7607 estava acompanhando o veículo furtado, foi cadastrado nos leitores de placa.\nQuando a equipe da PM estava na via Norte conduzindo o veículo furtado e os 02 indivíduos detidos, o sistema hikvision emitiu um alerta de passagem\ndo VW FOX, na mesma via, sendo constatado que estava seguindo a equipe da PM.\nO CSI informou a equipe da PM, a qual tentou abordar o referido veículo no cruzamento com a Avenida São José, porém desobedeceu a ordem de parada,\nmomento em que empreendeu fuga pela Avenida Sebastião Gualberto, sendo acompanhado pelas equipes de motos da GCM (GTAM) até o cruzamento com a Rua Carvalho de Araújo, \nonde um dos 03 ocupantes do veículo desembarcou e fugiu a pé, sendo detido logo em seguida pela equipe da GCM, que após consultas de praxe, constatou que o suspeito era\nforagido da justiça.\n",
