    "user_name": "Luiz Fernando Pereira",
    "descricao": "Em 12MAI22, por volta das 16h00min, equipe em patrulhamento com vistas ao veículo irradiado pelo CSI, FORD/ECO SPORT de emplacamento PKQ-3183, onde a proprietária seria procurada da justiça pelo artigo 171 (estelionato).\nApós breve acompanhamento pela via Dutra, logramos êxito em abordar o referido veículo pela rua Afonso Celso.\nApós consulta via Copom, retornou que a condutora/proprietária se encontrava com mandado de prisão em aberto pelo estado do DF com pena a cumprir de 12 anos de prisão no regime fechado.\nNa busca veicular foi localizada uma bolsa feminina que continha em seu interior documentos pessoais da abordada e vários cartões de crédito, informou a equipe que já tinha diversas passagens criminais por estelionato.\nParte encaminhada ao 5°DP para providências de polícia judiciária.",
