    "id_natureza": 209,
    "user_name": "Luiz Antonio Espósito",
    "descricao": "Câmeras: (405) = 08h45 a 08h47 - Após irradiado pelo Centro de Segurança e Inteligência (CSI) que um veiculo, emplacamento FYZ-6058, produto de furto no estado de Alagoas, trafegava pela Avenida dos Astronautas, foi dado início ao patrulhamento com vistas. Quando foi possível visualizar o veiculo acessando a rodovia Presidente Dutra sentido Rio de Janeiro, de imediato a equipe se deslocou até a localização do automóvel. Realizada a abordagem nas proximidades do km 143, foi constatado dois ocupantes no interior do veiculo, Fernando (condutor) e Romildo (Passageiro), após a realização de busca pessoal e no interior do veiculo nada de ilícito foi encontrado. Já, ao realizar a checagem do veiculo foi confirmado que se tratava de um veiculo produto de furto. Em conversa informal, foi relatado pelo senhor Fernando, que o veiculo pertence ao seu irmão, que atualmente reside no exterior e deixou o veiculo sob seus cuidado, conforme procuração apresentada, (destaca-se que o veiculo ainda não havia sido transferido) e que teria adquirido o automóvel como forma de pagamento de uma dívida, entretanto como esta não foi paga da maneira que foi combinado entre as partes, o antigo proprietário elaborou um boletim de ocorrência de furto. Diante dos fatos, os ocupantes e o veiculo foram conduzidos até o 6° Distrito Policial para apreciação da autoridade policial competente. Lavrado o Boletim de ocorrência número: DD8335-1/2022, presidido pela delegado de polícia o senhor doutor Régis Wanderley G. Germano, permanecendo o veiculo apreendido e os ocupantes ouvidos e liberados. Apoio GTAM 3020.",
