    "descricao": "APÓS DENUNCIA VIA 190 (SIOPM) NA QUAL  PELA PASSARELA DO CARREFOUR ESTARIAM 4 INDIVIDUOS EM ATITUDE SUSPEITA ONDE SEGUNDO O SOLICITANTE OS MESMOS IRIAM PRATICAM ROUBO A TRANSEUNTES NO LOCAL, DIANTE DESSA INFORMAÇÃO FOI INICIADO O MONITORAMENTO E LOCALIZADO OS INDIVIDUOS E AO PERCEBEREM A CHEGADA DA VIATURA COMEÇARAM A SE EVADIREM PELA PASSARELA SENTIDO AO OUTRO LADO, ONDE APÓS A SAIDA DA VTR OS MESMOS RETORNARAM PARA A PASSARELA E JÁ FORAM DE ENCONTRO A VITIMA QUE VINHA ANDANDO DE BICICLETA, MOMENTO ESSE EM QUE UM DOS INDIVIDUOS SACOU UM REVOLVER E ANUCIOU O ASSALTO LEVANDO A BICICLETA E UM CELULAR DA VITIMA  E SE EVADIRAM SENTIDO A AVENIDA FORTALEZA NO PARQUE INDUSTRIAL ONDE ESTE FOI PASSANDO PARA AS EQUIPES DE RUA POSSIVEIS ROTAS EM QUE OS MESMOS PODERIAM SEGUIR, DOIS INDIVIDUOS FORAM LOCALIZADOS E ABORDADOS PELA RUA PROXIMA A AVENIDA FORTALEZA E OS DEMAIS APÓS FUGA PELO JD ORIENTE  E APÓS UM BREVE ACOMPANHAMENTO AOS MESMOS PELAS RUAS DO BAIRRO SENDO LOGRADO EXITO EM DETER MAIS DOIS INDIVIDUOS JUNTAMENTE COM A BICICLETA, O CELULAR E UMA ARMA DE FOGO QUE POSTERIORMENTE FOI VERIFICADO QUE SE TRATAVA DE UM SIMULACRO INDIVIDUOS CONDUZIDOS AO DP, NO PRIMEIRO MOMENTO NAO FOI POSSIVEL LOCALIZAR A VITIMA DEVIDO AO CALOR E DESENROLR DA IOCORRENCIA MAS POSTERIORMENTE A MESMA FORA LOCALIZADA E CONDUZIDA AO DP, OCORRENCIA EM ANDAMENTO.",
