    "descricao": "APOS OCORRENCIA DE FURTO A ESTABELECIMENTO COMERCIAL POR PINDAMONHANGABA NESTA DATA POR VOLTA DAS 03H DA MANHA, O COI DA REFERIDA CIDADE IDENTIFICOU 03 VEICULOS UTILIZADOS NO CRIME, SENDO QRU DE GANGE DA MARCHA RÉ. UM DOS VEICULOS SENDO UMA VAN, FOI ABANDONADO NO LOCAL DOS FATOS (SENDO ESTA VAN PRODUTO DE FURTO). OUTROS 02 VEICULOS UTILIZADOS, UM SIENA CINZA ( QUE TAMBEM FOI UTILIZADO NO FURTO DA MESMA VAN) E UM NISSAN MARCH PRATA, SE EVADIRAM DO LOCAL COM OS CRIMINOSOS E TOMARAM DESTINO A SAO JOSE DOS CAMPOS. COM BASE NAS INFORMAÇÕES OS VEICULOS FORAM CADASTRADOS NO BLACKLIST DO CSI, E NA MESMA DATA AMBOS FORAM ABORDADOS COM APOIO DO MONITORAMENTO DO CSI. O SIENA FOI ABORDADO PELA POLICIA MILITAR PELO BAIRRO SANTA INES COM 1 OCUPANTE NO VEICULO, QUE FOI CONDUZIDO AO 7°DP ,  E O NISSAN MARCH TAMBEM OCUPADO POR 1 INDIVIDUO FOI ABORDADO PELA GCM PELO ANEL VIARIO E CONDUZIDO AO MESMO DISTRITO, ONDE ESTA SENDO ELABORADO O BOLETIM DE OCORRENCIA DO FURTO OCORRIDO POR PINDA E QUE DARA SEGUIMENTO A INVESTIGAÇÃO. OS 02 DETIDOS E OS 02 VEICULO UTILIZADOS NO CRIME FORAM DEIXADOS NA DELEGACIA AOS CUIDADOS DOS POLICIAIS CIVIS RESPONSÁVEIS PELO CASO.",
