    "id_natureza": 34,
    "user_name": "Rodrigo Jota Prado",
    "descricao": "*Com alerta do CSi, três são detidos pelas equipes de GAPE da GCM no bairro Campo dos Alemães*\n\nTudo começou após informações recebidas pelo CSi de que uma família tinha sido vítima de roubo a residência na zona norte da cidade, os indivíduos adentraram ao local e subtraíram vários objetos, além do veículo da família.\n\nApós pesquisa foi possível identificar a placa do veículo pelas câmeras inteligentes e o alerta foi dado por volta das 03h00 no bairro Campo dos Alemães, de imediato equipes das forças de segurança foram informadas em tempo real o trajeto do veículo e uma equipe de GAPE da GCM após recusa de parada dos meliantes começou um longo acompanhamento pelas ruas do bairro, em certo momento o carro foi abandonado e começou uma caçada á pé, com alguns deles pulando muro de residências e tentando se esconder dos agentes. \n\nApós cerco policial que contou com apoio das equipes do 46 BPMI rádio patrulha e força tática, três meliantes foram detidos pela GCM, produtos recuperados, veículo, uma arma apreendida e após contato com a vítima, todos conduzidos à Central de flagrantes para apresentação da ocorrência à autoridade policial. EM andamneto... *o individuo de nome VILNEI DIAS DA SILVEIRA constou como procurado da justiça*\n\nCâmera 561 (03h07/03h20) \nCâmera 560 (03h12:30/03h13:30)\nCâmera 590 (03h14:40/03h25)\nCâmera 517 (03h22/03h26)\n\nEquipe: GAPE 3020 e demais apoios",
