    "id_natureza": 34,
    "user_name": "Rodrigo Jota Prado",
    "descricao": "*GCM prende dupla que estava sendo monitorada pelo CSi após arrastão em ponto de ônibus*\n\nTudo começou quando um veículo spacefox na cor preta suspeito de assalto a um mercadinho pelo bairro Castanheiras em data anterior passaou por um dos radares inteligentes na zona leste, nesse momento o monitoramento CSI começou a monitorar o veículo pelo bairro São Vicente quando chegou a informação através do 190 que alguns estudantes que estavam no ponto de ônibus próximo a escola estadual do bairro foram vítimas de roubo por dois indivíduos. As equipes de rua foram informadas do acontecido e todo trajeto foi monitorado em tempo real e repassadas às viaturas, momento em que o veículo adentrou a rua Verglio Boschetti no bairro Coqueiro e foi interceptado pela equipe de GAPE da GCM, dois de imediato foram abordados e infelizmente um terceiro conseguiu fugir.\n\nNo total foram recuperados 08 aparelhos celulares, vítimas foram até a Central de flagrantes onde delegado de plantão retificou a voz de prisão dada aos meliantes, fez o registro da ocorrência, apreendeu o veículo usado nos crimes e devolveu os pertences as vítimas. Mais um final feliz \n\nCâmera 325 (22h40:30//22h41)\nCâmera 396 (22h41:30//22h42:30)\nCâmera 344 (22h46//22h49)\nCâmera 357 (22h49//22h50)\nCâmera 738 (22h49:49//22h55)",
