    "descricao": "Após tomar ciência de roubo ocorrido nas proximidades da EMEF Geraldo de Almeida onde dois indivíduos armados em uma moto teriam subtraído a moto de uma professora, as equipes de monitoramento iniciaram as verificações nos sistemas inteligentes e nas câmeras da região, sendo possível verificar o trajeto do veículo após o roubo. Após repassar as informações levantadas às equipes de rua, as equipes da GTAM iniciaram patrulhamento nas proximidades do local onde a moto foi visualizada pela ultima vez e lograram êxito em localiza-la. A Motocicleta produto do roubo foi conduzida até a Delegacia onde foi devolvida à vítima.\n\nCamera 897 as 10:04:45 - indivíduos sobem na contramão em frente a escola após roubar\nCamera 722 as 10:08:20 - indivíduos indo para região do Putim\nCamera 762 as 10:15:12 - indivíduos passando na Av. João Rodolfo Castelli\nCamera 647 as 10:15:45 - indivíduos acessando o bairro Vila Adriana",
