    "descricao": "APÓS VEÍCULO EM POSSE DE QUADRILHA QUE REALIZA CRIMES CONHECIDOS COMO “SAIDINHA DE BANCO”, NA QUAL ELES ABORDAVAM IDOSOS E OS LUDIBRIARAM COM FALSAS INFORMAÇÕES PARA SUBTRAIR DINHEIRO E PERTENCES DAS VÍTIMAS ALERTAR EM UM DOS RADARES INTELIGENTES AS EQUIPES DE MONITORAMENTO INICIARAM O ACOMPANHAMENTO DO VEÍCULO EM TEMPO REAL E COMITANTEMENTE IRRADIANDO A REDE RÁDIO, FOI QUANDO NA RODOVIA HENRIQUE EROLES O VEÍCULO FOI ABORDADO PELA POLÍCIA MILITAR. EM VISTORIA VEICULAR FOI ENCONTRADO A QUANTIA DE R$ 2.000,00 NA PORTA DO PASSAGEIRO, DOIS CARTÕES DE CRÉDITO DE PESSOAS DIFERENTES, UMA BOLSA FEMININA COM DOCUMENTOS E CONTAS DE ENERGIA DE UM ENDEREÇO EM SÃO JOSÉ DOS CAMPOS. AO SEREM QUESTIONADOS DISSERAM NÃO SABER DA ORIGEM DOS DOCUMENTOS E DEMAIS PERTENCES, SENDO ASSIM FORAM CONDUZIDOS A CENTRAL DE FLAGRANTES PARA APRECIAÇÃO DA AUTORIDADE DE PLANTÃO.  AO CHEGAR NA DELEGACIA A VÍTIMA SE APRESENTOU NO LOCAL E SE IDENTIFICOU COM O NOME DE UM DOS CARTÕES QUE SE ENCONTRAVAM EM POSSE DA QUADRILHA. A AUTORIDADE DE PLANTÃO EM POSSE DE TODAS AS INFORMAÇÕES LAVROU O BOLETIM DE FORMAÇÃO DE QUADRILHA E ESTELIONATO EM DESFAVOR DOS INDIVÍDUOS QUE FICARAM PRESOS A DISPOSIÇÃO DA JUSTIÇA.",
