    "id_natureza": 209,
    "user_name": "Denis Willian da Silva Amaral",
    "descricao": "Após GCCOM irradiar um veículo Gol Preto, emplacamento EAB - 7895, envolvido em furtos a residências em datas próximas havia sido detectado pelo monitoramento passando em radares inteligentes pela avenida Cassiopeia - Jardim Satélite. Simultaneamente, a equipe GTAM, composta pelas viaturas M- 03 e M-17 estava em deslocamento pela Avenida Andrômeda, quando avistou o veículo passar em sua frente no cruzamento da Av. Andrômeda com a Av. Cassiopeia com os vidros da frente abertos, sendo possível vizualizar dois indivíduos em seu interior, bem como alguns eletrodomésticos (televisão e microondas). A equipe procedeu no procedimento de abordagem, sendo possível realizá-la pela Rua Canopus, 427. Foi possível vizualizar que no momento em que foi dada a ordem de parada, ambos bateram fortemente os celulares que portavam no câmbio do veículo, aparentemente na intenção de\nquebrá-los. Conduzindo o veículo estava o Wellington Santos de Jesus, e na carona, Luis Felipe de Sousa Araujo. Em consulta criminal, contatou-se que\nambos possuíam ficha criminal por crimes de furto, entre outros, sendo o Wellington reincidente em crimes de furto à residência, e que havia poucos meses que ele havia saído da cadeia para responder os crimes em liberdade. Além da Televisão da Marca Philips e o Microondas Eletrolux, havia uma panela\nelétrica Walita no porta malas do veículo, e dois celulares quebrados nos bancos da frente. Os indivíduos informaram que pegaram os eletrodomésticos no\nbairro Pinheirinho dos Palmares para revender, porém além de não possuírem nota fiscal ou qualquer outro documento para comprovação, não souberam\ninformar a origem dos objetos. Também informaram que quebraram os celulares no momento da abordagem, pois possuíam informações\ncomprometedoras. A equipe informou os fatos ao CSI que fez contato com o 2° DP de Pindamonhangaba, o qual informou que esse veículo participou de\ndois furtos a residência naquela cidade, inclusive na casa de um Policial Militar, onde foram subtraídas munições. O CSI também fez contato com o 6° DP\nde São José dos Campos, sendo solicitado pelo Delegado de Polícia, Dr. Régis Wanderley G. Germano que a ocorrência fosse apresentada nesta unidade\npara posterior investigação Diante disso, foi solicitado apoio das equipes das viaturas 3016 e 3028 para a condução dos indivíduos e veículo ao 6°DP e as\nviaturas GTAM M-02 M-09 apoiaram na segurança e foram até a residência do Wellington solicitar aos familiares a documentação dele, porém sem\nsucesso. Já em solo policial, ambos confessaram aos policiais civis que praticaram dois furtos em residências utilizando o mesmo veículo, Gol Preto, na\ncidade de Pindamonhangaba há cerca de dois dias atrás, inclusive na residência de um Policial Militar, onde furtaram munições, e ao perceberam que se\ntratava de casa de policial, se evadiram rapidamente. O delegado de polícia, Dr. Régis, determinou a apreensão do veículo, dos dois celulares e dos três eletrodomésticos, sendo elaborado o B.O N°KK8874-2/2023 de Natureza Não Criminal e Apreensão de Objeto e Veículo.\n",
