    "descricao": "POLÍCIA EFETUA A DETENÇÃO DE INDIVÍDUO COM VEÍCULO CONTENDO PRODUTOS FURTADOS DE RESIDÊNCIAS EM SÃO JOSÉ DOS CAMPOS\n\n   DURANTE OPERAÇÃO DE VIGILÂNCIA POR MEIO DO  MONITORAMENTO DO  CSI, FOI DETECTADO UM VEÍCULO SUSPEITO QUE ESTAVA POTENCIALMENTE ENVOLVIDO EM FURTOS EM RESIDÊNCIAS ANTERIORES. IMEDIATAMENTE, AS EQUIPES DE PATRULHAMENTO DA POLÍCIA MILITAR FORAM ALERTADAS.\n   APÓS AS VIATURAS LOCALIZAREM O VEÍCULO, O INDIVÍDUO SUSPEITO ABANDONOU O CARRO E TENTOU FUGIR A PÉ, ADENTRANDO EM RESIDÊNCIAS E UTILIZANDO OS TELHADOS COMO VIA DE ESCAPE. AS EQUIPES POLICIAIS EMPENHADAS NA OPERAÇÃO DEMONSTRARAM GRANDE PERÍCIA E DETERMINAÇÃO, RESULTANDO NA CAPTURA BEM-SUCEDIDA DO INDIVÍDUO.\n   NO INTERIOR DO VEÍCULO, FORAM LOCALIZADOS DIVERSOS PRODUTOS QUE HAVIAM SIDO ROUBADOS DE RESIDÊNCIAS, INCLUINDO DINHEIRO,TELEVISORES, NOTEBOOKS E ELETRODOMÉSTICOS EM GERAL. DIANTE DOS FATOS, O INDIVÍDUO, O VEÍCULO E OS ITENS FURTADOS FORAM CONDUZIDOS À CENTRAL DE FLAGRANTES PARA A ADOÇÃO DAS MEDIDAS JUDICIAIS CABÍVEIS.\n\nDVB5790 PEUGEOT 206 PRATA 2007 TALAO 9356 FURTO\nVIATURA I46291\nRUA ACASSIA PEREIRA I75 CAMPO DOS ALEMAES\nCAMERA:590 13:15 AS 14:30 e \nCAMERA:517 13:13 AS 14:30 \nAPOIO CRUCIAL DA GCM NO MONITORAMENTO(GCM ESPOSITO)\n",
