    "id_natureza": 127,
    "user_name": "Rodrigo Jota Prado",
    "descricao": "*Equipes de GTAM e ROMU conseguem salvar idosas e seu pet em oficina em chamas*\n\nA equipe de monitoramento do CSI irradiou que visualizou chamas de fogo em grande proporção pela Oficina de motos situada na Rua Henrique Dias n 837.\n\nO monitoramento complementou a informação dizendo que havia ligações informando que dentro da Casa que fica na parte superior da oficina havia duas pessoas que não conseguiram se evadir do local, sendo que umas das pessoas era acamada e não andava.\n\nPelo local os municipies informaram que realmente no interior da residência havia duas pessoas que não conseguiram sair, porém devido ao alto volume das chamas, não tinha como acessar a residência pelo portão de entrada.\n\nDe imediato os integrantes da equipe desembarcaram e perceberam que havia uma janela que dava acesso a casa do vizinho. Os agentes municipais adentraram ao local pela janela e efetuaram o resgate, também pela Janela, das Senhoras Iris das Graças Santos Martins de 65 anos de idade, de sua Mãe , Maria das Graças Santos de 87 anos de idade, a qual não se locomove e vive em situação de cama e também de um cachorro.\n\nNesse ínterim, os bombeiros chegaram no local e iniciaram o procedimento para combater o fogo.\n\nApós retiradas da residência, as senhoras foram acomodadas dentro da viatura Romu 01, as quais passaram por uma análise clínica superficial do Médico do Corpo de Bombeiros, Dr. Guaglio, o qual não constatou alterações na saúde das socorridas.\nOs bombeiros conseguiram apagar o fogo.\nNão houve feridos na ocorrência.\n",
