    "descricao": "*POLÍCIA MILITAR CAPTURA PROCURADO DA JUSTIÇA COM AJUDA DO CSI*\n\nNa data de ontem 20/11 um fiat uno vivace prata de placa OLZ3276 foi roubado pelo bairro N.Horizonte, foi possível averiguar retroagindo as câmeras no dia do fato que um veículo peugeot 207 preto de placa HTD5348 escoltava o uno em alta velocidade sentido o Bom Retiro, na data de hoje o veículo peugeot 207 após passar por radares inteligentes foi identificado pela Av João Vicente do Nascimento Netto no bairro Dom Bosco em frente a uma residencia. De imediato as informações foi repassada à rede rádio e equipes do 46°BPMI conseguiram realizar a abordagem aos ocupantes do veículo, na garagem da residência foi identificada uma motocicleta com queixa de roubo, porém era falta de baixa, o dono da moto que estava na residência em consulta criminal foi identificado como procurado da justiça, um celular na busca pessoal foi constatado como produto de furto e ambos foram conduzidos para delegacia para apreciação da autoridade polcial, que ratificou a prisão e manteve o procurado à disposição da justiça. ",
