    "user_name": "Rodrigo Jota Prado",
    "descricao": "Equipe de investigação do 7° DP policial Fábio esteve no CSI juntamente com esse operador para averiguar um roubo de carreta SCANIA (QKJ2A36) em outra cidade, foi possível identificar pela Avenida Mario Covas a princípio um veículo Línea vermelho (HBJ2390) escoltando a carreta (sem placa ou tampada) as 02h50:55 na câmera 126.2 . Posterior é possível ver os dois veículos novamente na Mario Covas altura do Vale Sul porém na direção contrária, na câmera 006 as 02h57:31, depois acessando as Rua Antônio Aleixo sentido Satélite as 02h59:15.\n\nAs 03h15:32 o Línea aparece sozinho entrando na alça de acesso ao viaduto da Jonhson pela câmera 094 e às 03h19:59, também sozinho passa na câmera 006 na Mario Covas sentido litoral e por último na Mario Covas sentido Centro as 03h24:25 na câmera 005.\n\nPor volta das 03h10:47 na câmera 126.3 tem um veículo Polo azul (FXE8J27) que faz a escolta da carreta roubada até o Capuava, onde entram o bairro as 03h14:10 câmera 116.2 e 649, as 03h29:40 o polo sai sozinho.\n\nOs investigadores depois dessas informações estão fazendo diligência no bairro.",
