    "descricao": "*Troca de informações entre os Centros de Operações e demais forças de segurança do Vale Do Paraíba e grande São Paulo tem contribuido no combate a furto de veículos*\n\nNa noite dessa quarta feira 22 foi recebido a informação de que uma saveiro branca havia sido furtada no Jd Satélite, atráves do sistema de monitoramento do CSI foi possível verificar que poucos minutos antes o veículo havia deixado a cidade em direção a São Paulo, munidos dessa informação foi irradiado o alerta e equipe da PM patrulha 31023 com apoio do TOR 06227 conseguiu interceptar o veículo na altura do KM 197 pela rodovia presidente Dutra em Aruja, o proprietário foi solicitado a comparecer até o DP de Arujá, um indivíduo detido e mais um bem recuperado graças a união das forças.",
