    "id_natureza": 101,
    "user_name": "Deyvisson Henrique Alves",
    "descricao": "Equipe GTAM em patrulhamento pela região central, quando o CSI (Centro de Segurança e Inteligência) irradiou um veículo Gol cinza ostentando a placa EAI-4321, que seria de outro veículo produto de crime em data anterior por Osasco. Diante da informação a equipe iniciou patrulhamento com vistas, onde logro em abordar o veículo pela avenida Nelson D\\'avila fronte ao numeral 1941. Foi dada o comando de parada e o condutor Saulo de imediato atendeu. Foi realizado a revista, qualificação e consulta ao abordado e nada de ilícito foi encontrado. Questionado a respeito da placa que o veículo dele ostentava, disse que não tinha conhecimento de que a placa não correspondia às características do veículo, que apenas sabia que a documentação não estava regularizada. Diante dos fatos a equipe realizou a condução do indivíduo e do veículo a Central de Polícia Judiciária para apreciação do delegado. Foi elaborado o boletim de ocorrência de numeral QS2924-1/2023 de natureza: 311-Adulteração. Onde o indivíduo permaneceu a disposição da justiça e o veículo juntamente da placa (EAI-4321) foram apreendidos. Apoio E08",
    "origem": "Monitoramento em Tempo Real",
