    "descricao": "*Polícia Rodoviária Federal recupera veículo furtado através de informações do CSI*\n\nNa noite de quinta - feira 21, um veículo volkswagem gol GGU8934 foi furtado na cidade de São José dos Campos, após verificar passagem do veículo sentido Rodovia Presidente Dutra minutos após o acontecido, o monitoramento CSi repassou as informações em tempo real para as demais forças de segurança que compôem um grupo de ações no Vale do Paraíba e Grande São Paulo, e pela cidade de Itaquaquecetuba o carro foi achado pela PRF abandonado e com todos os pertences da vítima incluindo bolsa e um celular.\n\nIntegração e inteligência fazendo a diferença no combate ao crime.\n",
