    "descricao": "*Em ato heróico, equipe de ROMU salva homem do suicídio*\n\nNa noite desta quinta - feira 21, monitoramento do CSi atendendo diversas prioridades, entre elas, o monitoramento dos viadutos e passarelas da cidade no intúito de identificar possíveis tentantes contra a própria vida, identificou com um homem no parapeito do viaduto Vista Verde já com metade do corpo para fora, de imediato a informação foi repassada à rede rádio e uma equipe de ROMU encostou para atender a ocorrência, nessa hora com muito preparo e técnica, integrantes da equipe conseguiram puxá-lo ao solo e deixá-lo em posição segura, foi acionado equipe de resgate que compareceu ao local e encaminhou o indivíduo até o hospital Francisca Júlia para os primeiros atendimentos.\n\nCâmera 405 (20h33/20h55)",
