    "id_natureza": 102,
    "user_name": "Deyvisson Henrique Alves",
    "descricao": "A equipe estava em patrulhamento próximo ao UPA Campos do alemão, quando a GCCOM jogou na rede que havia uma moto azul próximo ao posto sete estrelas da rua Dr. João Batista de Souza Soares (estrada do imperador). De pronto, a equipe se deslocou até o local, onde foi possível localizar a motocicleta saindo do posto. Foi dado ordem de parada com sinais sonoros e luminosos, que foi desobedecido pelo condutor. De imediato foi iniciado um acompanhamento que prosseguiu pelas rodovia Henrique Eroles, após acessou a marginal da Dutra sentido RJ, quando próximo o KM116 BR060, a equipe conseguiu fazer a abordagem. Foi verificado como sendo o condutor Lucas Alexandre, o qual após pesquisas nada de irregular foi retornado. Também foi feito a vistoria na moto e nada de ilícito foi localizado, porém foi constatado um sistema irregular que suprime a placa. No local da abordagem, compareceu o Ramon Souza, que identificou como sendo o proprietário da motocicleta e que tinha emprestado ao Alexandre. Cabe ressaltar que Lucas, no momento da evasão, fez direção perigosa pilotando em altas velocidades na calçada com pedestre próximo, conduzindo em contramão e passando em sinal semafórico vermelho. Diante dos fatos, o condutor e o proprietário, bem como a motocicleta, foram conduzidos até o central de fragrante, o qual foi realizado um termo circunstanciado não criminal n°AB7740 -1/2024, além disso foram realizados os devidos precedimentos administrativos, como multas DG-00043023, DG-00043024, DG-00043025, DG-00043026, DG-00043027, DG-00043028 e a remoção administrativa do veículo, conforme termo de apreensão de veículo n°112426 e comprovante de recolhimento ou remoção n°3012046. Apoio: GTAM M-18, M-17, M-09, M-12, M-05. ROMU R03, R02 Polícia militar ROCAM, Rádio Patrulha, Atividade delegada, Águia.",
