    "id_natureza": 76,
    "user_name": "Deyvisson Henrique Alves",
    "descricao": "APÓS MONITORAMENT IRRADIAR ATITUDE SUSPEITA, Equipe GTAM em averiguação pelo Centro Pop, avistou um indivíduo negro entregando algo que aparentava ser um pino de cocaína a outro indivíduo. Após a visualização do fato, guarnição fez o retorno e abordou somente um undivíduo pela lateral do Centro Pop. Posterior a revista pessoal nada foi encontrado em sua posse, porém no local onde estava foi encontrado uma bolsa preta contendo 11 ependorfe de cocaína e a quantia de R$34,00. Durante a abordagem, chegou uma mulher exaltada tentando atrapalhar a abordagem vindo a desacatar a equipe, proferindo palavras de baixo calão como \"seus lixo. seus bando de filha da puta, está atrasando nosso lado...\" e ficou questionando a abordagem. Posterior foi identificada como Larissa, companheira de Yuri. Diante dos fatos, equipe conduziu os dois para a Central de Flagrantes, onde foi elaborado B.O Nº BK7358-1/2024 crime consumado de desacato e localização e apreensão de drogas. Posterior Yuri será averiguado na prática de tráfico de drogas (art. 33).",
