    "user_name": "Rodrigo Jota Prado",
    "descricao": "*Monitoramento CSI age rápido e identifica meliante dentro de UBS*\n\nApós sistema de alarme da UBS do Campos dos Alemães disparar na Central de Comunicação da Guarda Civil Municipal - GCCOM,  nesse momento o monitoramento CSi começou a retroagir as imagens no intúito de identificar algum ilícito e realmente foi identificado um meliante dentro da unidade, a informação de imediato foi repassada à equipe que já estava se deslocando para o atendimento do alarme e equipes de apoio se prontificaram a se deslocar também. Com as equipes no local, o monitoramento ainda estava em constante vigilância no momento em que visualizou o indivíduo pulando o alambrado e fugindo do local, equipes com essas informações realizaram o cerco e conseguiram interceptá-lo no terminal VLP do bairro. Após vistoria municiosa no posto, foi possível identificar uma porta arrombada e o furto de alguns materias entre eles uma enceradeira industrial, diante dos fatos, rés furtiva juntamente com o fora da lei foram encaminhados para a Central de flagrantes para deliberação da autoridade policial, ocorrência em andamento.\n\nCâmera 188.2 (01h51:50)\nCâmera 666.2 (01h12:18)\nCâmera 858     (01h11:15)\nCâmera 667    (01h13:00)",
